//      sum += counter.value;
//    });
//    return sum;
//  }
  render() {
    return(
      <nav className="navbar navbar-dar bg-dark">
        <span className="navbar-brand mb-0">React + API
          <span className="badge badge-success m-2">{ this.props.title }</span>
        </span>
      </nav>
    );
  }
}

export default Navbar;
